}

void solve()
{
    int n;
    cin >> n;
 
    si total;
    vector<vi> sets(n);
 
    f(i, 0, n)
    {
        int x;
        cin >> x;
 
        while(x--)
        {
            int y;
            cin >> y;
            sets[i].pb(y);
            total.insert(y);
        }
 
        sort(all(sets[i]));
    }
    int maxans = -1;
    for(auto ele : total)
    {
        si aux;
        f(i, 0, n)
        {
            if(!binary_search(all(sets[i]), ele))
            {
                for(auto j : sets[i])
                {
                    aux.insert(j);
                }
            }
        }
        maxans = max(maxans, (int)aux.size());
    }
    println(maxans);
}

using eCommerceBase.Helper;
using eCommerceBase.TokenStorage;
using Microsoft.Identity.Client;
using Microsoft.IdentityModel.Protocols.OpenIdConnect;
using Microsoft.IdentityModel.Tokens;
using Microsoft.Owin.Security;
using Microsoft.Owin.Security.Cookies;
using Microsoft.Owin.Security.Notifications;
using Microsoft.Owin.Security.OpenIdConnect;
using Owin;
using System.Configuration;
using System.Security.Claims;
using System.Threading.Tasks;
using System.Web;

namespace eCommerceBase
{
    public partial class Startup
    {
        // Load configuration settings from PrivateSettings.config
        private static string appId = ConfigurationManager.AppSettings["ida:AppId"];
        private static string appSecret = ConfigurationManager.AppSettings["ida:AppSecret"];
        private static string redirectUri = ConfigurationManager.AppSettings["ida:RedirectUri"];
        private static string graphScopes = ConfigurationManager.AppSettings["ida:AppScopes"];
        private static string tenant = ConfigurationManager.AppSettings["ida:Tenant"];

        public void ConfigureAuth(IAppBuilder app)
        {
            app.SetDefaultSignInAsAuthenticationType(CookieAuthenticationDefaults.AuthenticationType);

            app.UseCookieAuthentication(new CookieAuthenticationOptions());

            app.UseOpenIdConnectAuthentication(
                new OpenIdConnectAuthenticationOptions
                {
                    ClientId = appId,
                    Authority = "https://login.microsoftonline.com/"+ tenant +"/ v2.0",
                    Scope = $"openid email profile offline_access {graphScopes}",
                    RedirectUri = redirectUri,
                    PostLogoutRedirectUri = redirectUri,
                    TokenValidationParameters = new TokenValidationParameters
                    {
                        ValidateIssuer = false
                    },
                    Notifications = new OpenIdConnectAuthenticationNotifications
                    {
                        AuthenticationFailed = OnAuthenticationFailedAsync,
                        AuthorizationCodeReceived = OnAuthorizationCodeReceivedAsync
                    }
                }
            );
        }

        private static Task OnAuthenticationFailedAsync(AuthenticationFailedNotification<OpenIdConnectMessage,
            OpenIdConnectAuthenticationOptions> notification)
        {
            notification.HandleResponse();
            string redirect = $"/Home/Error?message={notification.Exception.Message}";
            if (notification.ProtocolMessage != null && !string.IsNullOrEmpty(notification.ProtocolMessage.ErrorDescription))
            {
                redirect += $"&debug={notification.ProtocolMessage.ErrorDescription}";
            }
            notification.Response.Redirect(redirect);
            return Task.FromResult(0);
        }

        private async Task OnAuthorizationCodeReceivedAsync(AuthorizationCodeReceivedNotification notification)
        {
            notification.HandleCodeRedemption();

            var idClient = ConfidentialClientApplicationBuilder.Create(appId)
                .WithRedirectUri(redirectUri)
                .WithClientSecret(appSecret)
                .Build();

            var signedInUser = new ClaimsPrincipal(notification.AuthenticationTicket.Identity);
            var tokenStore = new SessionTokenStore(idClient.UserTokenCache, HttpContext.Current, signedInUser);

            try
            {
                string[] scopes = graphScopes.Split(' ');

                var result = await idClient.AcquireTokenByAuthorizationCode(
                    scopes, notification.Code).ExecuteAsync();

                var userDetails = await GraphHelper.GetUserDetailsAsync(result.AccessToken);

                tokenStore.SaveUserDetails(userDetails);
                notification.HandleCodeRedemption(null, result.IdToken);
            }
            catch (MsalException ex)
            {
                string message = "AcquireTokenByAuthorizationCodeAsync threw an exception";
                notification.HandleResponse();
                notification.Response.Redirect($"/Home/Error?message={message}&debug={ex.Message}");
            }
            catch (Microsoft.Graph.ServiceException ex)
            {
                string message = "GetUserDetailsAsync threw an exception";
                notification.HandleResponse();
                notification.Response.Redirect($"/Home/Error?message={message}&debug={ex.Message}");
            }
        }
    }
}

import java.io.*;
import java.util.*;

class GFG {
	public static void main (String[] args) {
	   int n;
	   Scanner sc = new Scanner(System.in);
	   n = sc.nextInt();
	   int[] arr = new int[n];
	   for(int i = 0 ; i < n; i++) {
	       arr[i] = sc.nextInt();
	   }
	   int target = sc.nextInt();
	   
	   //lowerBound
	   int lo = -1, hi = n;
	   while(hi - lo  > 1) {
	       int mid = (lo + hi) / 2;
	       if(target > arr[mid])
	        lo = mid;
	       else
	        hi = mid;
	   }
	   System.out.println("lower_Bound = " + (lo + 1));
	   
	   //upperBound
	   int l = -1, h = n;
	   while(h - l  > 1) {
	       int mid = (l + h) / 2;
	       if(target >= arr[mid])
	        l = mid;
	       else
	        h = mid;
	   }
	   System.out.println("upper_Bound = " + (h));
	}
}

