class Solution {
public:
    vector<vector<int>> floodFill(vector<vector<int>>& image, int sr, int sc, int color) {
        
        vector<vector<int>> result = image;
        int n = image.size();
        int m = image[0].size();
        vector<vector<bool>> visited(n, vector<bool>(m, false));
        int di[] = {0, 0, -1, 1};
        int dj[] = {-1, 1, 0, 0};
        
        
        queue<int> q;
        q.push(sr);
        q.push(sc);
        visited[sr][sc] = true;
        int s_color = image[sr][sc];
        result[sr][sc] = color;
        while(!q.empty()) {
            int ci = q.front();
            q.pop();
            int cj = q.front();
            q.pop();
            
            for(int i = 0; i < 4; i++) {
                int ti = ci + di[i];
                int tj = cj + dj[i];
                
                if(ti >= 0 and ti < n and tj >= 0 and tj < m and !visited[ti][tj] and image[ti][tj] == s_color) {
                    q.push(ti);
                    q.push(tj);
                    visited[ti][tj] = true;
                    result[ti][tj] = color;
                }
            }
            
        }
        
        return result;
    }
};

function numberGenerator(input) {
    let m = Number(input[0]);
    let n = Number(input[1]);
    let l = Number(input[2]);
    let special = Number(input[3]);
    let control = Number(input[4]);

    for (let i = m; i > 0; i--) {
        for (let j = n; j > 0; j--) {
            for (let k = l; k > 0; k--) {
                let num = i * 100 + j * 10 + k;

                if (num % 3 == 0) {
                    special += 5;
                } else if (num % 5 == 0) {
                    special -= 2;
                } else if (num % 2 == 0) {
                    special *= 2;
                }

                if (special >= control) {
                    console.log(`Yes! Control number was reached! Current special number is ${special}.`);
                    return;
                }
            }
        }
    }
    console.log(`No! ${special} is the last reached special number.`);
}

class Solution {
public:
    vector<vector<int>> floodFill(vector<vector<int>>& image, int sr, int sc, int color) {
        
        vector<vector<int>> result = image;
        int n = image.size();
        int m = image[0].size();
        vector<vector<bool>> visited(n, vector<bool>(m, false));
        
        queue<int> q;
        q.push(sr);
        q.push(sc);
        visited[sr][sc] = true;
        int s_color = image[sr][sc];
        result[sr][sc] = color;
        while(!q.empty()) {
            int ci = q.front();
            q.pop();
            int cj = q.front();
            q.pop();
            
            if(ci + 1 < n and !visited[ci + 1][cj] and image[ci + 1][cj] == s_color) {
                q.push(ci + 1);
                q.push(cj);
                visited[ci + 1][cj] = true;
                result[ci + 1][cj] = color;
            }
            if(ci - 1 >= 0 and !visited[ci - 1][cj] and image[ci - 1][cj] == s_color) {
                q.push(ci - 1);
                q.push(cj);
                visited[ci - 1][cj] = true;
                result[ci - 1][cj] = color;
            }
            if(cj + 1 < m and !visited[ci][cj + 1] and image[ci][cj + 1] == s_color) {
                q.push(ci);
                q.push(cj + 1);
                visited[ci][cj + 1] = true;
                result[ci][cj + 1] = color;
            }
            if(cj - 1 >= 0 and !visited[ci][cj - 1] and image[ci][cj - 1] == s_color) {
                q.push(ci);
                q.push(cj - 1);
                visited[ci][cj - 1] = true;
                result[ci][cj - 1] = color;
            }
            
        }
        
        return result;
