function objectFactory(library, orders) {
  let results = [];
  for (let order of orders) {
    let obj = Object.assign({}, order.template);
    for (const methodName of order.parts) {
      obj[methodName] = library[methodName];
    }

    results.push(obj);
  }
  return results;
}

