unsigned short verificareTreiCifreAlaturateImpare(int n)
{
	int gasite = 0;

	while (n > 0)
	{
		if (gasite == 3)
		{
			break;
		}

		int ultimaCifra = n % 10;

		if (ultimaCifra % 2 != 0)
		{
			gasite++;
		}
		else
		{
			gasite = 0;
		}

		n /= 10;
	}

	if (gasite == 3) return 1;
	else return 0;
}

