int cifraDeControl(int n) {
    while (n >= 10) {  // ContinuÄƒm pÃ¢nÄƒ cÃ¢nd n devine un numÄƒr cu o singurÄƒ cifrÄƒ
        int suma = 0;
        while (n > 0) {
            suma += n % 10;  // AdÄƒugÄƒm ultima cifrÄƒ din n la suma
            n /= 10;         // EliminÄƒm ultima cifrÄƒ din n
        }
        n = suma;  // ActualizÄƒm n cu suma cifrelor sale
    }
    return n;  // ReturnÄƒm cifra de control
}

int main() {
    int numar;
    cout << "Introduceti un numar: ";
    cin >> numar;
    cout << "Cifra de control a numarului " << numar << " este: " << cifraDeControl(numar) << endl;
    return 0;
}

